Conflicts of interest could arise in the following circumstances (not all inclusive)

Being employed by or acting as a consultant to a competitor or potential competitor, supplier or competitor, regardless of the nature of the employment while employed with Tramontina.

Hiring or supervising family members or closely related people.

Serving as a board member for an outside commercial company or organization.

Owning or having a substantial interest in a competitor, supplier or contractor.

Accepting gifts, discounts, favors or services from a customer/potential customer, competitor or supplier unless equally available to all company Employee’s

Performing work as a vendor for Tramontina.



Employees with a conflict of interest question should seek advice from the Human Resources Manager.  Before engaging in any activity, transaction or relationship that might give rise to a conflict of interest, or the appearance thereof, Employees must seek review from the Humana Resources department. 



011   Rules of Conduct



Along with the advantages and opportunities offered by Tramontina, there are certain responsibilities and obligations that you are expected to meet.  Your primary and most important responsibility is to do a good job on the work assigned to you by your manager.  Rules and regulations are, however, necessary to provide for the safety and well-being of our Employees, customers and guests. Because compliance with the following is a condition of employment, violations may result in corrective action up to and including immediate termination.



These rules do not alter the at-will nature of your employment. You have the right to terminate your employment at any time, with or without cause or notice, and the Company has a similar right. 



Although it is not possible to provide an exhaustive list of all types of unacceptable conduct and performance, the following are some examples of such unacceptable behaviors:



Falsification of employment records, employment information or other records;

Recording the work time of another Employee, allowing any Employee to record another Employee’s work time, or allowing falsification of any timecard, whether yours or another Employee’s;

Theft or the deliberate or careless damage of the Company’s property or the property of any Employee, visitor or other third party involved in the Company’s business operations;

Use or removal of materials, supplies, tools or products of the Company, a visitor or third-party involved in the Company’s business operations without advanced permission from management;

Violation of the Company’s policies governing use of business equipment, electronic resources and information systems;

Provoking a physical fight or engaging in physical fighting during working hours or on premises owned or occupied by the Company;

Using abusive, violent, threatening or obscene language at any time during working hours or while on premises owned or occupied by the Company;

Absence of 2 consecutive scheduled workdays without prior notice to the Company;

Failing to obtain permission from your Manager to leave work or be offline during scheduled working time (not including legally required meal and rest breaks) unless the reason is legally protected;

Failing to observe working schedules, including meal and rest breaks;

Abusing or misusing paid sick leave (note: for Employees subject to mandatory sick leave laws, the provisions of the applicable policy govern sick leave issues); 

Failing to provide a certificate from a health care provider when requested or required to do so in accordance with applicable law;

Working overtime without authorization or refusing to work assigned hours;

Violating any safety, health or security policy, rule or procedure of the Company; 

Refusal to perform assigned duties as requested by a Manager unless unsafe or contrary to Company policies or procedures;

Discrimination or harassment in violation of our EEO or Prohibited Harassment Policy against any Employee, client, contractor, visitor, or other individual involved in the operations of the Company based upon race, religion, age, sex, national origin, disability or any other protected characteristic under applicable law; and 

Use, consumption or possession of intoxicating beverages or illegal drugs on the Company premises, during working hours, or a work event, or otherwise violating the Company’s Drug and Alcohol Policy.  

Insubordination

Destruction of company property

Wasting time or conducting personal business during work hours, using company equipment for non-work-related reasons. 

Solicitating business (selling items or services) or soliciting funds from coworkers. 



The above list is not intended to be all‑inclusive.  Its primary purpose is to identify the standards of performance/conduct that are expected and required for the benefit of all Employees. 



